If the sum of the integers written is equal to a multiple of $7,$ Dr. Happypentimento will randomly pair up each team and have the members on the same team work together. Prof. Happypentimento has already randomly chosen the $4$ integer divisors $k_1,$ $k_2,$ $k_3,$ $k_4$ of $2024$ that are pairwise distinct and distinct from $1:$ \[573, 712, 998, 3579\]

After a chaotic but uneventful exchange of printers, all students write their integers. The sum of the integers is $525$. What is the probability that a student writes a $7$ such that the final exam still counts for the grade? \boxed{final\_answer}
